sources.public/css/home.scss:
@use 'grid';
@import url('https://fonts.googleapis.com/css?family=Montserrat:300,600&display=swap');
@import url('https://fonts.googleapis.com/css?family=Source+Code+Pro:400,700&display=swap');
@import 'mixins';

body {
    background: #beecfa;
    margin: 0;
}

* {
    box-sizing: border-box;
}

img {
    max-width: 100%;
    height: auto;
}

// .main {
//     @media(max-width: 767px) {
//         display: none;
//     }
// }

// .no-desktop {
//     @media(min-width: 768px) {
//         display: none;
//     }
// }

body {

    &.is-menu-open {
        .header__menu-dropdown {
            opacity: 1;
            visibility: visible;
        }

    }

    &.is-menu-white,
    &.is-menu-open {

        .header__btn-toggle {
            background-color: #fff;
        }

        .header__logo {
            svg path {
                fill: #fff;
            }
        }
    }
}

.header {
    padding-top: 24px;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    z-index: 500;

    &__logo {
        width: 50px;

        svg path {
            transition: all .6s ease-in-out;
        }
    }

    &__row {
        display: flex;
        align-items: center;
        justify-content: space-between;
        position: relative;
        z-index: 300;
    }

    &__btn-toggle {
        -webkit-appearance: none;
        appearance: none;
        background: none;
        border: none;
        padding: 0;
        margin: 0;
        width: 30px;
        height: 30px;
        border-radius: 50%;
        background-color: #333;
        cursor: pointer;
        transition: all .3s ease-in-out;
        outline: none;

        &:hover {
            transform: scale(1.4);
        }

        >span {
            position: fixed;
            top: -99999px;
            left: -99999px;
            display: block;
        }
    }

    &__menu-dropdown {
        transition: 0.5s ease-in-out all;
        opacity: 0;
        visibility: hidden;
        position: fixed;
        width: 100%;
        height: 100%;
        top: 0;
        left: 0;
        background-color: rgba(1, 24, 50, .9);
        display: flex;
        justify-content: center;
        align-items: center;
        z-index: 100;

        nav {
            width: 100%;
        }

        ul {
            list-style-type: none;
            font-family: "Montserrat", sans-serif;
            letter-spacing: 8px;
            font-size: 60px;
            margin: 0;
            padding: 0;
            text-align: center;
        }

        li {
            margin: 24px 0;
        }

        li a {
            text-transform: uppercase;
            color: #fff;
            text-decoration: none;
            display: block;
        }
    }
}

.home,
.work {

    position: absolute;
    left: 0;
    width: 100%;
    height: 100vh;

}

.home {
    top: 50px;
}

.home,
.work {
    &__wrapper {
        width: 100%;
    }

    .grid-container {
        display: flex;
        width: 100%;
        height: 100%;
        position: relative;
        ;
    }
}

.home__content,
.work__content {
    display: flex;
    align-items: center;
    height: 100%;
}

.home {

    &__heading {
        color: #333;
        font-size: 120px;
        line-height: 116px;
        font-family: "Montserrat", sans-serif;
        margin: 0;

        span {
            display: block;
        }

        span.light {
            font-weight: 300;
        }

        @media(max-width: 1023px) {
            font-size: 90px;
            line-height: 86px;
        }

        @media(max-width: 682px) {
            font-size: 75px;
            line-height: 76px;

        }
    }

    &__subline {
        font-family: "Source Code Pro", monospace;
        font-size: 23px;
        text-decoration: underline;
        margin-top: 28px;
        display: block;
        color: #333;
    }

    &__description {
        font-family: "Source Code Pro", monospace;
        font-size: 16px;
        color: #333;
        display: block;
        margin-top: 12px;
        line-height: 26px;

        .home__link {
            color: inherit;
            text-decoration: none;
        }

        .stuff {
            position: relative;
            padding: 0 24px;
            width: 150px;
            text-align: center;
            display: inline-block;

            &:before {
                content: '';
                position: absolute;
                bottom: 0;
                left: 0;
                width: 100%;
                height: 1px;
                background-color: #333;
            }

            &:after {
                content: '\0020';
                padding: 0 2px;

            }
        }

        .bold {
            font-weight: bold;
        }
    }

    &__arrow {
        margin-top: 40px;
        text-align: center;
    }

    &__presentation-content {
        max-width: 1000px;
    }
}

.work {
    &__main-col {
        position: relative;
    }

    &__counter-container {
        position: absolute;
        top: 50%;
        left: 0;
        transform: translateY(-50%);
        color: #fff;
        text-align: center;
        z-index: 3;
        font-family: "Montserrat", sans-serif;
        font-size: 34px;
        opacity: 0;
        visibility: hidden;
        padding-left: 30px;
        transition: color .8s ease-in-out;

        &.dark {
            color: #333;
        }
    }

    &__numbers {
        display: flex;
        align-items: flex-end;
        justify-content: center;

    }

    &__pipe {
        padding: 0 4px;
    }

    &__total {
        font-size: 18px;
    }

    &__project-label {
        font-size: 14px;
        text-transform: uppercase;
        margin-top: 12px;
        font-family: "Source Code Pro", monospace;
    }

    &__presentation {
        width: 100%;
    }

    &__slide {
        display: flex;
        align-items: center;
        justify-content: space-between;
        // background-color: #6653a6;
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
        padding: 0 78px;

        &.dark {
            .work__information {
                color: #333;
            }
        }

        &.dark {
            .work__view-more {
                a {
                    border-color: #333;
                    color: #333;

                    &:hover {
                        background-color: #333;
                        color: #fff;
                    }
                }
            }
        }
    }

    &__picture {
        max-width: 656px;

        img {
            max-width: 100%;
            height: auto;
        }
    }



    &__information {
        flex: 1;
        font-family: "Montserrat", sans-serif;
        color: #fff;
    }

    &__type {
        display: block;
        font-size: 30px;
    }

    &__title {
        display: block;
        font-size: 60px;
        line-height: 60px;
        font-weight: 600;

        @media(max-width: 1023px) {
            font-size: 40px;
            line-height: 40px;
        }
    }

    &__description {
        font-family: "Source Code Pro", monospace;
        font-weight: 300;
        font-size: 16px;
        line-height: 26px;
    }

    &__table {
        width: 100%;
        font-family: "Source Code Pro", monospace;
        font-size: 14px;

        &-row {
            display: flex;
            padding-top: 5px;
        }

        &-column,
        &-header {
            flex: 1;
        }

        &-column {
            line-height: 24px;
        }

        &-header {
            font-weight: 500;
            text-transform: uppercase;
        }
    }

    &__slider {
        position: absolute;
        top: 0;
        left: 50%;
        width: 100%;
        height: 100%;
        transform: translateX(-50%);
    }

    &__view-more {
        margin-top: 44px;

        a {
            border: 1px solid #fff;
            color: #fff;
            text-decoration: none;
            width: 236px;
            font-family: "Source Code Pro", monospace;
            font-weight: 500;
            font-size: 16px;
            line-height: 24px;
            border-radius: 100px;
            display: flex;
            align-items: center;
            justify-content: center;
            text-align: center;
            height: 72px;
            transition: all .4s ease-in-out;

            &:hover {
                background-color: #fff;
                color: #000;
            }
        }
    }

}

// Work-detail

// General
.circular-link {

    margin-top: 44px;

    a {
        border: 1px solid #fff;
        color: #fff;
        text-decoration: none;
        width: 236px;
        font-family: "Source Code Pro", monospace;
        font-weight: 500;
        font-size: 16px;
        line-height: 24px;
        border-radius: 100px;
        display: flex;
        align-items: center;
        justify-content: center;
        text-align: center;
        height: 72px;
        transition: all .4s ease-in-out;

        &:hover {
            background-color: #fff;
            color: #000;
        }
    }
}

@keyframes slide {
    0% {
        left: 100%;
    }

    100% {
        left: -100%;
    }
}

.work-detail {
    &__banner {
        min-height: calc(100vh - 100px);
        display: flex;
        align-items: flex-end;
        position: relative;
        background-color: #fff;
        overflow: hidden;
    }

    &__banner-image {
        position: relative;
        z-index: 2;
        display: flex;

        img {
            max-width: 100%;
        }
    }

    &__banner-text {
        position: absolute;
        left: 0;
        bottom: 256px;
        display: block;
        font-family: "Montserrat", sans-serif;
        width: 100%;
        text-align: center;
        font-size: 210px;
        font-weight: 600;
        color: #a5a4b2;
        text-transform: uppercase;
        white-space: nowrap;

    }

    &__description {
        padding: 95px 0;
        background-color: #6653a6;

        color: #e5e5e6;
        font-family: "Source Code Pro", monospace;
    }

    &__description-title {
        font-size: 28px;
        font-weight: 600;
        font-family: "Montserrat", sans-serif;
    }

    &__description-text {
        line-height: 28px;
    }

    &__screen {
        background-color: #fff;
    }

    &__screen-image {
        margin: -85px 0;
        margin-bottom: -120px;
        display: flex;

        &.frontback {
            margin-bottom: -265px;
            margin-top: -42px;
        }

        &.border {
            border-top-width: 70px;
            border-bottom-width: 70px;
            border-left-width: 50px;
            border-right-width: 55px;
            border-style: solid;
            margin-top: -66px;
            margin-bottom: -66px;
        }

        &.no-overlap {
            margin-top: 0;
